import { Chart, Tooltip, Axis, Interval, Guide, Coord } from 'viser-react';
import * as React from 'react';

const data = [{
  type: 'USD',
  value: 340,
  cat: '1960'
}, {
  type: 'BDT',
  value: 20760,
  cat: '办公用品'
}, {
  type: 'USD',
  value: 28750,
  cat: '办公用品'
}, {
  type: 'BDT',
  value: 4090,
  cat: '技术'
}, {
  type: 'USD',
  value: 9880,
  cat: '技术'
}, {
  type: 'BDT',
  value: 40988,
  cat: '技术'
}, {
  type: 'USD',
  value: 14870,
  cat: '家具'
}, {
  type: 'BDT',
  value: 37098,
  cat: '家具'
}, {
  type: 'USD',
  value: 49099,
  cat: '家具'
}];

const scale = [{
  dataKey: 'value',
  ax: 55000,
  min: 0,
  nice: false,
  alias: '金额（元）'
}];

const label = {
  textStyle: {
    fill: '#aaaaaa'
  }
}

const tickLine = {
  alignWithLabel: false,
  length: 0
}

const line = {
  lineWidth: 0
}

const grid = {
  lineStyle: {
    lineWidth: 0
  }
}

const title = {
  offset: 30,
  textStyle: {
    fontSize: 12,
    fontWeight: 300
  }
}

const lineStyle = {
  stroke: '#c0c0c0',
  lineDash: [2, 2]
}

const style = {
  fill: '#c0c0c0',
  fontSize: 12,
  fontWeight: '300',
  textAlign: 'center',
  rotate: -90
}

const labelInterval = ['value', {
  textStyle: {
    fill: '#8d8d8d'
  },
  offset: 10,
  formatter: function formatter(text) {
    return text.replace(/(\d)(?=(?:\d{3})+$)/g, '$1,');
  }
}]

const color = ['cat', ['#face1d', '#37c461', '#2194ff']]

class Reactjs extends React.Component {
  render() {
    return (
      <Chart forceFit height={400} data={data} scale={scale} padding={[20, 0, 50, 80]}>
        <Tooltip />
        <Axis dataKey="type" label={label} tickLine={tickLine} line={line}/>
        <Axis dataKey="value" label={null} title={title} grid={grid}/>
        <Coord direction='LB' type='rect'/>
        <Interval position="type*value" color={color} opacity={1} size={26} label={labelInterval}/>
        <Guide
          type="text"
          top={true}
          position={['Floor', 'min']}
          content='SQBL'
          style={style}
          offsetX={-70}
        />
        <Guide
          type="text"
          top={true}
          position={['Floor', 'min']}
          content='SQCL'
          style={style}
          offsetX={-70}
        />
        <Guide
          type="text"
          top={true}
          position={['Floor', 'min']}
          content='办公用品'
          style={style}
          offsetX={-70}
        />
        <Guide
          type="line"
          start={['-20%', '33.2%']}
          end={['100%', '33.2%']}
          lineStyle={lineStyle}
        />
        <Guide
          type="line"
          start={['-20%', '66.8%']}
          end={['100%', '66.8%']}
          lineStyle={lineStyle}
        />
      </Chart>
    );
  }
}
export default  Reactjs
